import './notification.css'

function Notification ({name, date, picture, content, message}) {
    return (
        <div className="noti">
            <img src={picture} className="img" alt="Profile Picture"/>

            <p><strong>{name}</strong> {content}</p>
            <h6>{date}</h6>
        </div>
    ) 
}

export default Notification;
